class Home_festival extends React.Component{
    render(){
        return(
        <div class="primary">
        <header class= "nav">
            <Header/> 
        </header>
        <div class="navbar">
            <Nav/>
        </div>
        
        <div class= "main">
            <Data/>
        </div>
    </div>
        )}
    }

    class Header extends React.Component{

render(){
    return(
        <div class="header_left">
        <div class ="logo">
        <img src="LOGO coba.png" /></div>
        </div>
    )

}}

class Nav extends React.Component {
        state = {
            click: false
        }

        render(){
            return(
                <div class="header_right">
                    <a class="navbar_tombol" onClick={() => {this.setState({ click: !this.state.click })}}>≡</a>
                    {this.state.click ? <Isi_nav /> : null}
                </div>
            );
        }
    }
function Li(props){
    return (
        <div class={props.div}>
        <li> <a href= {props.link} ><span> {props.text} </span> <figure class={props.figure_class}><img src={props.img}/><figcaption class={props.figcaption_class}> <strong>{props.judul}</strong><br/> <br/>{props.starting} <br/><strong>{props.harga} </strong><br/><br/> {props.tanggal} <br/> {props.jam} <br/> {props.tempat}</figcaption></figure></a> </li></div>
    )
}
function Li2(props){
    return (
        <div class={props.div}>
        <li> <a href= {props.link} ><span> {props.text} </span></a> </li></div>
    )
}
function Select(props){
    return (

        <option value={props.value}>{props.text}</option>
    )
}
class Isi_nav extends React.Component{
    render(){
            return(
                <nav>
                <div class="navbar_isi">
                    <ul>
                            <Li2 link="/home" text="Home" />
                            <Li2 link="/proyek/bioskop" text="Bioskop" />
                            <Li2 link="/proyek/festival" text="Festival" />
                            <Li2 link="#contact" text="About"/>
                        </ul><select >
                        <Select value="" text="All"/>
                        <Select value="" text="Banyuwangi"/>
                        <Select value="" text="Jakarta"/>
                        <Select value="" text="Surabaya"/>
                        <Select value="" text="malang"/>
                        <Select value="" text="Jogja"/>
                        </select>
                        </div>
                </nav>
            );
        }

}
class Data extends React.Component{
            render(){
                return(
                    <div class="data" >
                        <section >
                <div id="Festival" class="view"><h2>Festival</h2> </div>
            <div class="main_festival">
                <Li link="/proyek/pembayaran" img="f1.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="DWP X" starting="Starting from" harga="Rp. 135.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Li link="/proyek/pembayaran" img="f2.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Indonesia Nostalgia Festival" starting="Starting from" harga="Rp. 200.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Li link="/proyek/pembayaran" img="f3.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Music Festival" starting="Starting from" harga="Rp. 150.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Li link="/proyek/pembayaran" img="f4.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Music Festival" starting="Starting from" harga="Rp. 150.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                
                <Li link="/proyek/pembayaran" img="f5.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Konser Raisa" starting="Starting from" harga="Rp. 200.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Li link="/proyek/pembayaran" img="f6.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Jessie J" starting="Starting from" harga="Rp. 500.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Li link="/proyek/pembayaran" img="f7.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Blues Festival" starting="Starting from" harga="Rp. 200.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Li link="/proyek/pembayaran" img="f8.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Showcase concert Afgan" starting="Starting from" harga="Rp. 350.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
            
                <Li link="/proyek/pembayaran" img="f9.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Seafood Festival" starting="Starting from" harga="Rp. 100.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Li link="/proyek/pembayaran" img="f10.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Food Truck Festival" starting="Starting from" harga="Rp. 100.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Li link="/proyek/pembayaran" img="f11.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Fall Festival" starting="Starting from" harga="Rp. 150.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Li link="/proyek/pembayaran" img="f12.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Acoustic Festival" starting="Starting from" harga="Rp. 150.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                
                </div></section>  <Footer/>
                    </div>
                )
            }
        }
        function Setting(props){
    return(
        <li><a href={props.page}>{props.sesi}</a></li>
    )
    }
function Setting2(props){
    return(
        <li><a href={props.link}><img src={props.image} class="image" /></a></li>
    )
    }
function Setting3(props){
    return(
        <li class="list">{props.teks}</li>
    )
    }
function Setting4(props){
    return(
        <li><img src={props.pembayaran} /></li>
    )
    }

class Footer extends React.Component{
            render(){
                return(
                    <div class="bot">
                    <footer id="contact">
                        <div class="row">
                            <div class="col-4 col-s-12">
                                <p><b>HUBUNGI KAMI</b></p>
                                <ul>
                                    <Setting3 teks="082 345 678 910" />
                                    <Setting3 teks="email : GoTiket@gmail.com" />
                                </ul>
                            </div>

                            <div  class="col-4 col-s-12">
                                <p><b>KUNJUNGI KAMI</b></p>
                                <ul>
                                    <Setting3 teks="Jl. Ahmad Yani, Banyuwangi, Jawa Timur" />
                                </ul>
                            </div>
                            
                            <div  class="col-4 col-s-12">
                                <p><b>PEMBAYARAN</b></p>
                                <ul>
                                    <Setting4 pembayaran="bayar1.png" />
                                    <Setting4 pembayaran="bayar2.png" />
                                    <Setting4 pembayaran="bayar3.png" />
                                    <Setting4 pembayaran="bayar4.png" />
                                    <Setting4 pembayaran="bayar5.png" />
                                </ul>
                            </div>

                            <div class="col-12 col-s-12">
                                <div class="col-6 col-s-12">
                                    <div class="teks5">
                                        <p>© GoTiket 2020. Hak Cipta Dilindungi</p>
                                    </div>
                                </div>
                                <div class="col-6 col-s-12">
                                    <div class="teks6">
                                        <p>Negara : Indonesia</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </footer></div>
                )
            }
        }
        export default Home_festival;
